import React, { Component } from "react";
import voxLogo from "../img/vox-media-logo.png"
import leidosLogo from "../img/leidos_logo.png"
import mercuryLogo from "../img/mercury_logo.png"

class ExperienceIcon extends React.Component {
  render() {
    const workLogos = [
      voxLogo,
      leidosLogo,
      mercuryLogo
    ]

    const logo = workLogos.find((logo) => this.props.logo === logo)
    // return <img src={this.props.logo} alt={this.props.alt_text}></img>;
    return <img src={logo} className="exp-logo" alt="test"></img>;
  }
}

export default ExperienceIcon;
